import React from 'react'
import "react-responsive-carousel/lib/styles/carousel.min.css"; // requires a loader
import { Carousel } from 'react-responsive-carousel';


const Cards = () => {

    return (
        <div>
            <Carousel showArrows={false} showThumbs={false} showIndicators={false} showStatus={false} interval={3000} autoPlay={true} infiniteLoop={true} >
                <section
                    className="p-10 grid grid-cols-1 sm:grid-cols-1 md:grid-cols-3 lg:grid-cols-3 xl:grid-cols-3 gap-5">
                    </section>
     
              
            </Carousel>
        </div>
    )
}

export default Cards
